-- Set up constraints

ALTER TABLE ONLY "Authors"
    ADD CONSTRAINT "Authors_pkey" PRIMARY KEY (id);

ALTER TABLE ONLY "Books"
    ADD CONSTRAINT "Books_ISBN_key" UNIQUE ("ISBN");
ALTER TABLE ONLY "Books"
    ADD CONSTRAINT "Books_pkey" PRIMARY KEY (id);

ALTER TABLE ONLY "Items"
    ADD CONSTRAINT "Items_Barcode_key" UNIQUE ("Barcode");
ALTER TABLE ONLY "Items"
    ADD CONSTRAINT "Items_pkey" PRIMARY KEY (id);

ALTER TABLE ONLY "Media"
    ADD CONSTRAINT "Media_pkey" PRIMARY KEY (id);

ALTER TABLE ONLY "Patrons"
    ADD CONSTRAINT "Patrons_pkey" PRIMARY KEY (id);

ALTER TABLE ONLY "Publishers"
    ADD CONSTRAINT "Publishers_pkey" PRIMARY KEY (id);


-- Add foreign keys

ALTER TABLE ONLY "Books"
    ADD CONSTRAINT "Books_Author_fkey" FOREIGN KEY ("Author") REFERENCES "Authors"(id);
ALTER TABLE ONLY "Books"
    ADD CONSTRAINT "Books_Publisher_fkey" FOREIGN KEY ("Publisher") REFERENCES "Publishers"(id);

ALTER TABLE ONLY "Items"
    ADD CONSTRAINT "Items_Book_fkey" FOREIGN KEY ("Book") REFERENCES "Books"(id);
